/*
 * An instance of Box represent the content of a rectangular region inside the patent.
 * It can be the minimum rectangular area containing a word formed by consecutive
 * chars, a char or a set of black pixels each one 8-connected with at least another
 * pixel in the area.
 * */
class Box {

	// Maximum ratio between font wideness and space between ascii chars
	static const double LETTER_SPACING = 1.0;
	// Maximum height ratio between a big char and a small char of the same font
	static const double ASCII_SAME_FONT_THRESHOLD = 1.9;


private:

	// Position and dimensions of the first Box of the ones merged into this instance
	int initialW;
	int initialH;
	int initialX1;
	int initialX2;
	int initialY1;
	int initialY2;


public:

	// If true (false) the char is in landscape (portrait) mode
	bool rotation;
	// Top-left corner
	int x1;
	int y1;
	// Bottom-right corner
	int x2;
	int y2;
	// # of chars merged to the first one
	int countMergedChars;
	// Word inside the box
	string text;

	// Bag of words that this Box may represent with a given probability
	vector<double> probs;
	vector<string> words;


	/*
	 * Construct a rectangular box from the top-left corner at coords (x1,y1)
	 * to the bottom-right corner at coords (x2,y2).
	 * */
	Box(int x1, int y1, int x2, int y2) :
		rotation(false),
		x1(x1),
		y1(y1),
		x2(x2),
		y2(y2),
		countMergedChars(0),
		text("") { }

	/*
	 * Merge box to this instance. The result is the minimum rectangular area
	 * that contains both.
	 * */
	void merge(const Box& box) {

		x1 = min(x1, box.x1);
		y1 = min(y1, box.y1);
		x2 = max(x2, box.x2);
		y2 = max(y2, box.y2);

	}

	/*
	 * Return true if box contains one or more chars that are part of the same
	 * word represented by this instance of Box and comes right after it.
	 * */
	bool isASCIIMergeable(const Box& box, double forwadSpacing) {

		// Initialize initial Box position and dimensions
		if (countMergedChars == 0) {

			initialH = y2 - y1;
			initialW = x2 - x1;

			initialX1 = x1;
			initialX2 = x2;
			initialY1 = y1;
			initialY2 = y2;

		}

		// Return false if this instance of Box or box is not a word
		if (words.size() == 0 || box.words.size() == 0)
			return false;

		if (words[0] == "?" || box.words[0] == "?")
			return false;

		if (words[0].length() + box.words[0].length() > 10)
			return false;

		int w = x2 - x1;
		int h = y2 - y1;
		int wBox = box.x2 - box.x1;
		int hBox = box.y2 - box.y1;


		bool isSameHeight = false;
		bool isAligned = false;
		bool isAfter = false;
		bool isNearby = false;

		// Verify if the box to be merged is part of the same word of this instance based
		// on the patent orientation
		if (rotation) {

			isSameHeight = wBox <= initialW * ASCII_SAME_FONT_THRESHOLD && initialW <= wBox * ASCII_SAME_FONT_THRESHOLD;
			isAligned = box.x2 <= initialX2 + w * 0.5 && box.x1 >= initialX1 - w * 0.5;
			isAfter = box.y2 <= y1 + LETTER_SPACING * h / (countMergedChars + 1);
			isNearby = box.y2 >= y1 - forwadSpacing * h / (countMergedChars + 1);

		} else {

			isSameHeight = hBox <= initialH * ASCII_SAME_FONT_THRESHOLD && initialH <= hBox * ASCII_SAME_FONT_THRESHOLD;
			isAligned = box.y2 <= initialY2 + h * 0.5 && box.y1 >= initialY1 - h * 0.5;
			isAfter = box.x1 >= x2 - LETTER_SPACING * w / (countMergedChars + 1);
			isNearby = box.x1 <= x2 + forwadSpacing * w / (countMergedChars + 1);

		}

		return isSameHeight && isAligned && isAfter && isNearby;

	}


	/*
	 * Reorganize the bag of words such that it contains just possible figure's titles.
	 * */
	void extractTitles() {

		// Remove "FIG" or "FIGURE" from title
		for (int i = 0; i < words.size(); i++)
			// Title starts with "FIG"
			if (words[i].length() < 6) words[i] = words[i].substr(3);
			// Title starts with "FIGURE"
			else words[i] = words[i].substr(6);

		// Recalculate probabilities for each title
		for (int i = 0; i < words.size(); i++) {

			double prob = probs[i];

			for (int j = i+1; j < words.size(); )
				if (words[i] == words[j]) {

					prob += probs[j];
					probs.erase(probs.begin() + j);
					words.erase(words.begin() + j);

				} else j++;

		}


	}


	/*
	 * Merge this instance of Box with box. It should be used just if both contain chars.
	 * */
	void mergeASCII(const Box& box) {

		merge(box);

		// Add text from box's words and recompute probabilities (keep the first 10 words).
		vector<string> fooWords;
		vector<double> fooProbs;

		for (int i = 0; i < probs.size(); i++)
			for (int j = 0; j < box.probs.size(); j++) {
				fooWords.push_back(words[i] + box.words[j]);
				fooProbs.push_back(probs[i] * box.probs[j]);
			}

		for (int i = 0; i < fooProbs.size(); i++)
			for (int j = i + 1; j < fooProbs.size(); j++)
				if (fooProbs[i] < fooProbs[j]) {

					double fooP = fooProbs[i];
					fooProbs[i] = fooProbs[j];
					fooProbs[j] = fooP;

					string fooW = fooWords[i];
					fooWords[i] = fooWords[j];
					fooWords[j] = fooW;

				}

		probs.clear();
		words.clear();

		for (int i = 0; i < min<int>(10, fooProbs.size()); i++) {

			// Patch for figure's titles
			if (fooWords[i].length() > 4 && fooWords[i][3] == 'I')
				fooWords[i][3] = '1';

			probs.push_back(fooProbs[i]);
			words.push_back(fooWords[i]);

		}

		countMergedChars += box.countMergedChars + 1;

	}


	/*
	 * Compute the probability that this box contains a figure's title.
	 * */
	double isFigureTitleProb() {

		double result = 0.0;

		for (int i = 0; i < words.size(); i++) {

			if (words[i].length() >= 3 && words[i].length() <= 10) {

				int matches = 0;

				if (words[i][0] == 'F')
					matches++;
				if (words[i][1] == 'I' || words[i][1] == '/' || words[i][1] == 'T')
					matches++;
				if (words[i][2] == 'G')
					matches++;

				if (words[i].length() <= 6) {

					if (matches >= 2)
						result += probs[i];

					continue;

				}

				if (words[i][3] == 'U')
					matches++;
				if (words[i][4] == 'R')
					matches++;
				if (words[i][5] == 'E')
					matches++;

				if (matches >= 4)
					result += probs[i];

			}

		}

		return result;

	}


	/*
	 * Return true iff this Box contains chars.
	 * */
	bool isASCII() {
		return words.size();
	}


	/*
	 * Return a string representation for this instance of Box.
	 * */
	string toString(int marginX, int marginY) {

		std::ostringstream sstm;

		sstm << "4 " << (x1-marginX) << " " << (y1-marginY) << " " << (x2+marginX) << " " << (y1-marginY) << " " <<	(x2+marginX) << " " << (y2+marginY) << " " << (x1-marginX) << " " << (y2+marginY) << " " << text;

		return sstm.str();

	}

};


/*
 * Represent the center of mass of a box where the mass is given by its area.
 * */
class Cluster {

public:
	double x;
	double y;
	int weight;

	/*
	 * Construct a cluster.
	 * */
	Cluster(double x, double y, int weight) :
		x(x), y(y), weight(weight) {
	}


	/*
	 * Add this instance of Cluster with a box. The result is equal to center of mass of the box
	 * represented by Cluster and another box added together.
	 * */
	Cluster& operator+=(const Box& box) {

		int boxWeight = (box.x2 - box.x1) * (box.y2 - box.y1);

		this->x = ((this->x) * weight + (box.x1 + box.x2) * 0.5 * boxWeight) / (weight + boxWeight);
		this->y = ((this->y) * weight + (box.y1 + box.y2) * 0.5 * boxWeight) / (weight + boxWeight);

		this->weight += boxWeight;

		return *this;

	}

};


